const PortfolioLink = props => (
  <li>
    <Link href={`/post?title=${props.title}`}>
      <a>{props.title}</a>
    </Link>
  </li>
);

export default class Footer extends React.Component {
  render() {
    return;
    <Link href={`/post?title=${props.title}`}>
      <a>{props.title}</a>
    </Link>;
  }
}
